def _unstack_multiple(data, clocs, fill_value=None):
    if len(clocs) == 0:
        return data

    index = data.index
    level_numbers = []

    for loc in clocs:
        if isinstance(loc, tuple):
            level_number = index.get_loc_level(loc, level=None)
            if level_number is None:
                level_number = index.get_loc_level(loc, level=0)
                if level_number is None:
                    raise KeyError(f"Level {loc} not found")
            level_numbers.append(level_number)
        else:
            level_numbers.append(index._get_level_number(loc))

    rlocs = [i for i in range(index.nlevels) if i not in level_numbers]

    shape = [len(index.levels[i]) for i in level_numbers]
    group_index = get_group_index([index.codes[i] for i in level_numbers], shape, sort=False, xnull=False)

    comp_ids, obs_ids = compress_group_index(group_index, sort=False)
    recons_codes = decons_obs_group_ids(comp_ids, obs_ids, shape, [index.codes[i] for i in level_numbers], xnull=False)
